import React, { Component } from "react";

import { BrowserRouter, Route } from "react-router-dom";

import Home from "./components/Home";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Route exact path="/" Component={Home} />
      </BrowserRouter>
    );
  }
}

export default App;
